import { Tab, Tabs } from 'semantic-ui-react'
export default function TabsGame({ game }) {
    const { } = game;

    const panes = [
        {
            menuItem: "Informacion",
            render: () => {
                <Tab.Pane>
                    <h1>info game</h1>
                </Tab.Pane>
            }
        }
    ]
    return (
        <div>
            <h1>Tabsgame</h1>
        </div>
    )
}
